import React from "react";
import axios from "axios";
import '../style/admin.css';

const API = "https://63a5721a318b23efa793a770.mockapi.io/api/produce/"

class PageAdmin extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
          product: [],
          id: null,
          name: "",
          avatar: "",
          quatity: "",
          description:""
        };
    }
    setStatus = () => {
        this.setState({ showAddForm: !this.state.showAddForm });
    }
    componentDidMount() {
        axios
            .get(API)
            .then(response => {
                this.setState({ product: response.data });
            })
            .catch(error => {
                console.log(error);
            });
    }
    render() {
        return (
            <div>

                <div className="container">
                    <div className="row">
                        <div className="col-sm-12">
                            <div className="card">
                                <div className="card-body">
                                    <h4 class="Title_table">Quản lý sản phẩm</h4>
                                    <p className="card-text">
                                    <button className="btn btn-primary"> <a sty  href={`/Add/{products.id}`}>Thêm sản phẩm mới</a></button>
                                    </p>
                                    {this.state.showAddForm ? this.formAddBook() : null}

                                    <table className="table table-bordered">
                                        <thead>

                                            <tr>
                                                <th>ID</th>
                                                <th>Tên sản phẩm</th>
                                                <th>Ảnh sản phẩm</th>
                                                <th>Gía</th>
                                                <th>Mô tả sản phẩm</th>
                                                <th>Xóa</th>
                                                <th>Sửa</th>

                                            </tr>
                                        </thead>

                                        <tbody>
                                            {this.state.product.map((products) =>(
                                                <tr >
                                                    <td><textbox type="text" name="id" onChange={this.handleChange} /> {products.id}</td>
                                                    <td>{products.name}</td>
                                                    <td><img className="img2" src={products.avatar} alt={products.name} /></td>
                                                    <td>{products.quatity}</td>
                                                    <td>{products.description}</td>
                                                    <td> 
                                                        <button  className="btn btn-primary mr-2" >
                                                            <a   className="btn btn-primary mr-2" href={`/Delete/${products.id}`}>Edit</a>
                                                        </button>
                                                    </td>
                                                    <td>
                                                    <button  className="btn btn-primary mr-2" >
                                                            <a  className="btn btn-primary mr-2" href={`/Update/${products.id}`}>Delete</a>
                                                        </button>
                                                    </td>
                                                </tr>
                                            ))}
                                            </tbody>
                                    </table>
                                    
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                {this.state.showEditForm ? this.formEditBook() : null}
             </div>
        );
     }
 }
export default PageAdmin;
